        options: [{ text: 'Yes', type: 'yesno' },
        { text: 'No', type: 'yesno' }]

    },
    {
        questionText: 'How many days of the week do you exercise together?',
        options: [{ text: 'Paris', type: 'radio' },
        { text: 'Berlin', type: 'radio' },
        { text: 'London', type: 'radio' },
        { text: 'Rome', type: 'radio' }]
